import React from 'react';

import {
  Switch,
  Route,
} from 'react-router-dom';

import Home from './pages/Home/Home';

const App = () => {
  return (
    <Switch>
      <Route exact path="/" component={Home} />
    </Switch>
  );
}

export default App;
